import React from 'react';

const Card = ({ name, email, id }) => {
	return ( 
		<div className='tc grow bg-gray br3 pa3 ma2 dib bw2 shadow-5'>
			<img alt='robots' 
			src={'https://robohash.org/brodie'} 
			src={'https://robohash.org/slade'}
			src={'https://robohash.org/craig'}
			src={'https://robohash.org/janine'}
			src={'https://robohash.org/robyn'}
			src={'https://robohash.org/duegan'}
			src={'https://robohash.org/courtenay'}
			src={'https://robohash.org/jamin'}
			src={'https://robohash.org/sabrina'}
			/>
			<div>
				<h2>{name}</h2>
				<p>{email}</p>
			</div>
		</div>
	);
}

export default Card;
